function loadChart(){var t=[4,8,15,16,23,42],i=420,n=20,r=d3.scaleLinear().domain([0,d3.max(t)]).range([0,i]),f=d3.select(".chart").attr("width",i).attr("height",n*t.length),u=f.selectAll("g").data(t).enter().append("g").attr("transform",function(t,i){return"translate(0,"+i*n+")"});u.append("rect").attr("width",r).attr("height",n-1);u.append("text").attr("x",function(n){return r(n)-3}).attr("y",n/2).attr("dy",".35em").text(function(n){return n})}window.onload=loadChart;